import React from "react";
import Header from "../components/Header/Header";
import AddStockPost from "../components/AddStockPost/AddStockPost";
import StockHoldings from "../components/StockHoldings/StockHoldings";

class Home extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <AddStockPost />
        <StockHoldings 
          ROI={this.props.ROI}
          currentMarketPrice={this.props.currentMarketPrice}
          getStockPrice={this.props.getStockPrice}
          selectedTickerSymbol={this.props.selectedTickerSymbol}
          />
      </div>
    );
  }
};

export default Home;
